import React, { useState } from 'react';
import '../styles/dashboard-components.css';

const BehaviorDopamineSection: React.FC = () => {
  const [selectedTimePeriod, setSelectedTimePeriod] = useState<'day' | 'week' | 'month'>('day');
  const [activeView, setActiveView] = useState<'presence' | 'habits' | 'screen-time' | 'rewards'>('presence');

  // Sample data - would come from your API
  const habits = [
    { name: 'Morning meditation', completed: true, streak: 7, target: 7, color: '#10b981' },
    { name: 'Exercise', completed: false, streak: 4, target: 5, color: '#3b82f6' },
    { name: 'Read 30 minutes', completed: true, streak: 3, target: 7, color: '#8b5cf6' },
    { name: 'No social media after 9 PM', completed: false, streak: 2, target: 7, color: '#f59e0b' }
  ];

  const screenTimeToday = {
    total: 6.2,
    productive: 3.8,
    social: 1.2,
    entertainment: 1.2,
    goal: 5.0
  };

  // Custom PieChart component
  const PieChart: React.FC<{ percentage: number; color: string; size: number }> = ({ 
    percentage, 
    color, 
    size 
  }) => {
    const strokeWidth = 8;
    const radius = (size - strokeWidth) / 2;
    const circumference = 2 * Math.PI * radius;
    const strokeDasharray = circumference;
    const strokeDashoffset = circumference - (percentage / 100) * circumference;

    return (
      <div style={{ position: 'relative', width: size, height: size }}>
        <svg width={size} height={size} style={{ transform: 'rotate(-90deg)' }}>
          <circle
            cx={size / 2}
            cy={size / 2}
            r={radius}
            fill="none"
            stroke="#e5e7eb"
            strokeWidth={strokeWidth}
          />
          <circle
            cx={size / 2}
            cy={size / 2}
            r={radius}
            fill="none"
            stroke={color}
            strokeWidth={strokeWidth}
            strokeDasharray={strokeDasharray}
            strokeDashoffset={strokeDashoffset}
            strokeLinecap="round"
            style={{ transition: 'stroke-dashoffset 0.5s ease-in-out' }}
          />
        </svg>
        <div style={{
          position: 'absolute',
          top: '50%',
          left: '50%',
          transform: 'translate(-50%, -50%)',
          textAlign: 'center'
        }}>
          <div style={{ fontSize: '16px', fontWeight: 'bold', color: '#374151' }}>
            {percentage}%
          </div>
        </div>
      </div>
    );
  };

  // Calculate presence percentages based on metrics
  const calculatePresenceData = () => {
    const screenTime = 6.2; // hours
    const activityTime = 0.75; // 45 minutes in hours
    const socialConsumption = 2.5; // hours of social media/entertainment

    // Algorithm: presence increases with activity, decreases with excessive screen time
    // Connection increases with balanced consumption, decreases with excessive social media
    
    const presenceScore = Math.min(100, Math.max(0, 
      70 - (screenTime - 4) * 10 + activityTime * 20
    ));
    
    const connectionScore = Math.min(100, Math.max(0,
      80 - socialConsumption * 15 + activityTime * 10
    ));
    
    const absentScore = 100 - presenceScore;
    const distractedScore = 100 - connectionScore;
    
    return {
      presentConnected: Math.round((presenceScore * connectionScore) / 100),
      presentDistracted: Math.round((presenceScore * distractedScore) / 100),
      absentNumb: Math.round((absentScore * connectionScore) / 100),
      absentRestless: Math.round((absentScore * distractedScore) / 100)
    };
  };

  const presenceData = calculatePresenceData();

  return (
    <div className="health-section">
      <div className="section-header">
        <h3>Behavior & Dopamine</h3>
        <div className="time-period-selector">
          <button 
            className={selectedTimePeriod === 'day' ? 'active' : ''}
            onClick={() => setSelectedTimePeriod('day')}
          >
            Day
          </button>
          <button 
            className={selectedTimePeriod === 'week' ? 'active' : ''}
            onClick={() => setSelectedTimePeriod('week')}
          >
            Week
          </button>
          <button 
            className={selectedTimePeriod === 'month' ? 'active' : ''}
            onClick={() => setSelectedTimePeriod('month')}
          >
            Month
          </button>
        </div>
      </div>

      <div className="behavior-content">
        {/* Tab Navigation */}
        <div style={{ display: 'flex', borderBottom: '1px solid #e5e7eb', marginBottom: '16px' }}>
          {[
            { key: 'presence', label: 'Presence Matrix' },
            { key: 'habits', label: 'Habits' },
            { key: 'screen-time', label: 'Screen Time' },
            { key: 'rewards', label: 'Rewards' }
          ].map((tab) => (
            <button
              key={tab.key}
              onClick={() => setActiveView(tab.key as any)}
              style={{
                padding: '8px 16px',
                border: 'none',
                background: 'none',
                cursor: 'pointer',
                fontSize: '12px',
                color: activeView === tab.key ? '#3b82f6' : '#64748b',
                borderBottom: activeView === tab.key ? '2px solid #3b82f6' : '2px solid transparent',
                fontWeight: activeView === tab.key ? 'bold' : 'normal'
              }}
            >
              {tab.label}
            </button>
          ))}
        </div>

        {/* Tab Content */}
        <div className="tab-content">
          {activeView === 'presence' && (
            <div style={{ padding: '16px' }}>
              <div style={{ 
                display: 'grid', 
                gridTemplateColumns: '1fr 1fr', 
                gap: '12px',
                height: '200px'
              }}>
                {/* Top Left - Present + Connected */}
                <div style={{
                  display: 'flex',
                  flexDirection: 'column',
                  alignItems: 'center',
                  justifyContent: 'center',
                  backgroundColor: '#f0f9ff',
                  borderRadius: '8px',
                  padding: '16px'
                }}>
                  <div style={{ fontWeight: 'bold', fontSize: '11px', marginBottom: '8px', textAlign: 'center' }}>
                    PRESENT + CONNECTED
                  </div>
                  <PieChart percentage={presenceData.presentConnected} color="#10b981" size={80} />
                </div>

                {/* Top Right - Present + Distracted */}
                <div style={{
                  display: 'flex',
                  flexDirection: 'column',
                  alignItems: 'center',
                  justifyContent: 'center',
                  backgroundColor: '#fef3c7',
                  borderRadius: '8px',
                  padding: '16px'
                }}>
                  <div style={{ fontWeight: 'bold', fontSize: '11px', marginBottom: '8px', textAlign: 'center' }}>
                    PRESENT + DISTRACTED
                  </div>
                  <PieChart percentage={presenceData.presentDistracted} color="#f59e0b" size={80} />
                </div>

                {/* Bottom Left - Absent + Numb */}
                <div style={{
                  display: 'flex',
                  flexDirection: 'column',
                  alignItems: 'center',
                  justifyContent: 'center',
                  backgroundColor: '#f3f4f6',
                  borderRadius: '8px',
                  padding: '16px'
                }}>
                  <div style={{ fontWeight: 'bold', fontSize: '11px', marginBottom: '8px', textAlign: 'center' }}>
                    ABSENT + NUMB
                  </div>
                  <PieChart percentage={presenceData.absentNumb} color="#6b7280" size={80} />
                </div>

                {/* Bottom Right - Absent + Restless */}
                <div style={{
                  display: 'flex',
                  flexDirection: 'column',
                  alignItems: 'center',
                  justifyContent: 'center',
                  backgroundColor: '#fef2f2',
                  borderRadius: '8px',
                  padding: '16px'
                }}>
                  <div style={{ fontWeight: 'bold', fontSize: '11px', marginBottom: '8px', textAlign: 'center' }}>
                    ABSENT + RESTLESS
                  </div>
                  <PieChart percentage={presenceData.absentRestless} color="#ef4444" size={80} />
                </div>
              </div>
            </div>
          )}

          {activeView === 'habits' && (
            <div style={{ height: '220px', padding: '16px' }}>
              <h4 style={{ margin: '0 0 16px 0', fontSize: '14px', color: '#374151' }}>
                Daily Habits Progress
              </h4>
              
              <div style={{ display: 'flex', flexDirection: 'column', gap: '8px' }}>
                {habits.map((habit, index) => (
                  <div key={index} style={{
                    display: 'flex',
                    alignItems: 'center',
                    gap: '8px',
                    padding: '8px',
                    backgroundColor: habit.completed ? '#f0fdf4' : '#fef2f2',
                    borderRadius: '6px',
                    border: `1px solid ${habit.completed ? '#bbf7d0' : '#fecaca'}`
                  }}>
                    {/* Completion checkbox */}
                    <div style={{
                      width: '16px',
                      height: '16px',
                      borderRadius: '3px',
                      backgroundColor: habit.completed ? habit.color : 'white',
                      border: `2px solid ${habit.color}`,
                      display: 'flex',
                      alignItems: 'center',
                      justifyContent: 'center',
                      fontSize: '10px',
                      color: 'white',
                      fontWeight: 'bold'
                    }}>
                      {habit.completed && '✓'}
                    </div>

                    {/* Habit name */}
                    <div style={{ flex: 1 }}>
                      <div style={{ 
                        fontSize: '12px', 
                        fontWeight: habit.completed ? 'bold' : 'normal',
                        color: habit.completed ? '#15803d' : '#dc2626'
                      }}>
                        {habit.name}
                      </div>
                    </div>

                    {/* Streak indicator */}
                    <div style={{ textAlign: 'right' }}>
                      <div style={{ fontSize: '12px', fontWeight: 'bold', color: habit.color }}>
                        {habit.streak}/{habit.target}
                      </div>
                      <div style={{ fontSize: '9px', color: '#64748b' }}>
                        streak
                      </div>
                    </div>
                  </div>
                ))}
              </div>

              <div style={{ 
                marginTop: '12px',
                display: 'flex',
                justifyContent: 'space-between',
                padding: '8px',
                backgroundColor: '#fef3c7',
                borderRadius: '6px',
                border: '1px solid #fbbf24'
              }}>
                <span style={{ fontSize: '11px', color: '#92400e' }}>
                  Today: {habits.filter(h => h.completed).length}/{habits.length} completed
                </span>
                <span style={{ fontSize: '11px', fontWeight: 'bold', color: '#92400e' }}>
                  {Math.round((habits.filter(h => h.completed).length / habits.length) * 100)}%
                </span>
              </div>
            </div>
          )}

          {activeView === 'screen-time' && (
            <div style={{ height: '220px', padding: '16px' }}>
              <h4 style={{ margin: '0 0 16px 0', fontSize: '14px', color: '#374151' }}>
                Screen Time Breakdown (Today)
              </h4>
              
              {/* Screen time donut chart simulation */}
              <div style={{ 
                display: 'flex', 
                justifyContent: 'center', 
                alignItems: 'center',
                height: '120px'
              }}>
                <div style={{ position: 'relative', width: '100px', height: '100px' }}>
                  <svg width="100" height="100" style={{ transform: 'rotate(-90deg)' }}>
                    {/* Background circle */}
                    <circle
                      cx="50"
                      cy="50"
                      r="40"
                      fill="none"
                      stroke="#f1f5f9"
                      strokeWidth="12"
                    />
                    {/* Productive time (61% of circle) */}
                    <circle
                      cx="50"
                      cy="50"
                      r="40"
                      fill="none"
                      stroke="#10b981"
                      strokeWidth="12"
                      strokeDasharray={`${2 * Math.PI * 40 * 0.61} ${2 * Math.PI * 40 * 0.39}`}
                      strokeDashoffset="0"
                    />
                    {/* Social media (19% of circle) */}
                    <circle
                      cx="50"
                      cy="50"
                      r="40"
                      fill="none"
                      stroke="#f59e0b"
                      strokeWidth="12"
                      strokeDasharray={`${2 * Math.PI * 40 * 0.19} ${2 * Math.PI * 40 * 0.81}`}
                      strokeDashoffset={`-${2 * Math.PI * 40 * 0.61}`}
                    />
                    {/* Entertainment (19% of circle) */}
                    <circle
                      cx="50"
                      cy="50"
                      r="40"
                      fill="none"
                      stroke="#ef4444"
                      strokeWidth="12"
                      strokeDasharray={`${2 * Math.PI * 40 * 0.19} ${2 * Math.PI * 40 * 0.81}`}
                      strokeDashoffset={`-${2 * Math.PI * 40 * 0.8}`}
                    />
                  </svg>
                  <div style={{
                    position: 'absolute',
                    top: '50%',
                    left: '50%',
                    transform: 'translate(-50%, -50%)',
                    textAlign: 'center'
                  }}>
                    <div style={{ fontSize: '16px', fontWeight: 'bold', color: '#374151' }}>
                      {screenTimeToday.total}h
                    </div>
                    <div style={{ fontSize: '9px', color: '#64748b' }}>
                      total
                    </div>
                  </div>
                </div>
              </div>

              {/* Breakdown */}
              <div style={{ 
                display: 'flex', 
                flexDirection: 'column',
                gap: '4px',
                marginTop: '16px'
              }}>
                {[
                  { label: 'Productive', value: screenTimeToday.productive, color: '#10b981' },
                  { label: 'Social Media', value: screenTimeToday.social, color: '#f59e0b' },
                  { label: 'Entertainment', value: screenTimeToday.entertainment, color: '#ef4444' }
                ].map((item, index) => (
                  <div key={index} style={{ 
                    display: 'flex', 
                    justifyContent: 'space-between',
                    alignItems: 'center',
                    fontSize: '12px'
                  }}>
                    <div style={{ display: 'flex', alignItems: 'center', gap: '6px' }}>
                      <div style={{ 
                        width: '8px', 
                        height: '8px', 
                        backgroundColor: item.color, 
                        borderRadius: '2px' 
                      }} />
                      <span style={{ color: '#64748b' }}>{item.label}</span>
                    </div>
                    <span style={{ fontWeight: 'bold', color: '#374151' }}>
                      {item.value}h
                    </span>
                  </div>
                ))}
              </div>

              <div style={{ 
                marginTop: '12px',
                padding: '8px',
                backgroundColor: screenTimeToday.total > screenTimeToday.goal ? '#fef2f2' : '#f0fdf4',
                borderRadius: '6px',
                border: `1px solid ${screenTimeToday.total > screenTimeToday.goal ? '#fecaca' : '#bbf7d0'}`
              }}>
                <p style={{ 
                  margin: 0, 
                  fontSize: '11px', 
                  color: screenTimeToday.total > screenTimeToday.goal ? '#dc2626' : '#15803d'
                }}>
                  {screenTimeToday.total > screenTimeToday.goal ? '⚠️' : '✅'} 
                  {' '}Goal: {screenTimeToday.goal}h | Current: {screenTimeToday.total}h
                </p>
              </div>
            </div>
          )}

          {activeView === 'rewards' && (
            <div style={{ height: '220px', padding: '16px' }}>
              <h4 style={{ margin: '0 0 16px 0', fontSize: '14px', color: '#374151' }}>
                Daily Dopamine Reward Score
              </h4>
              
              {/* Reward score gauge */}
              <div style={{ 
                display: 'flex', 
                justifyContent: 'center', 
                alignItems: 'center',
                height: '100px'
              }}>
                <div style={{ position: 'relative', width: '120px', height: '60px', overflow: 'hidden' }}>
                  <svg width="120" height="60">
                    {/* Background arc */}
                    <path
                      d="M 10 50 A 40 40 0 0 1 110 50"
                      fill="none"
                      stroke="#e2e8f0"
                      strokeWidth="8"
                    />
                    {/* Progress arc (75% = good day) */}
                    <path
                      d="M 10 50 A 40 40 0 0 1 85 20"
                      fill="none"
                      stroke="#10b981"
                      strokeWidth="8"
                      strokeLinecap="round"
                    />
                  </svg>
                  <div style={{
                    position: 'absolute',
                    bottom: '10px',
                    left: '50%',
                    transform: 'translateX(-50%)',
                    textAlign: 'center'
                  }}>
                    <div style={{ fontSize: '20px', fontWeight: 'bold', color: '#10b981' }}>
                      75
                    </div>
                    <div style={{ fontSize: '10px', color: '#64748b' }}>
                      reward score
                    </div>
                  </div>
                </div>
              </div>

              {/* Score breakdown */}
              <div style={{ 
                display: 'flex', 
                flexDirection: 'column',
                gap: '6px',
                marginTop: '16px'
              }}>
                {[
                  { activity: 'Completed Morning Routine', points: '+15', color: '#10b981' },
                  { activity: 'Exercise (30 min)', points: '+20', color: '#10b981' },
                  { activity: 'Healthy Meals', points: '+15', color: '#10b981' },
                  { activity: 'Social Media <2h', points: '+10', color: '#10b981' },
                  { activity: 'Reading Instead of TV', points: '+15', color: '#10b981' },
                  { activity: 'Impulse Purchase', points: '-5', color: '#ef4444' }
                ].map((item, index) => (
                  <div key={index} style={{ 
                    display: 'flex', 
                    justifyContent: 'space-between',
                    alignItems: 'center',
                    padding: '4px 8px',
                    backgroundColor: '#f8fafc',
                    borderRadius: '4px',
                    fontSize: '11px'
                  }}>
                    <span style={{ color: '#64748b' }}>{item.activity}</span>
                    <span style={{ 
                      fontWeight: 'bold', 
                      color: item.color,
                      fontSize: '12px'
                    }}>
                      {item.points}
                    </span>
                  </div>
                ))}
              </div>

              <div style={{ 
                marginTop: '8px',
                textAlign: 'center',
                fontSize: '10px',
                color: '#64748b'
              }}>
                Daily Average: 68 | Personal Best: 89
              </div>
            </div>
          )}
        </div>
      </div>
    </div>
  );
};

export default BehaviorDopamineSection;
